import React, {Component, PropTypes} from 'react';

import {
	View,
	Image,
	Text,
	TouchableHighlight
} from 'react-native';

import styles from './styles.js';

const LOADFAILED_PIC_URL = 'data:image/png;base64,';

export default class LoadFailed extends Component{
	render(){

		let {style, onPressButton, buttonText, text, source} = this.props;

		return (
			<View style={styles.Failed}>
                <Image
                    source={source}
                    style={styles.errorImage}
                />
                <View
                    style={styles.loadFailed}
                >
                    <Text style={styles.loadFailedText}>
                    	{text}
                    </Text>
                </View>
                <TouchableHighlight onPress={onPressButton} style={styles.button} underlayColor='#22a9e2'>
                    <Text style={styles.buttonText}>{buttonText}</Text>
                </TouchableHighlight>
            </View>
		)
	}
  
    static propTypes = {
        onPressButton: PropTypes.func,
        style: PropTypes.oneOfType([
	        PropTypes.object,
	        PropTypes.array,
	    ]),
	    text: PropTypes.string,
	    buttonText: PropTypes.string,
	    source: PropTypes.object
    };

    static defaultProps = {
    	source: {uri:LOADFAILED_PIC_URL},
    	text: '网络不给力，请再试试吧。',
    	buttonText: '重试'
    };
}


